import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Redirect, Route} from "react-router-dom";
import Navbar from './components/navbar/navbar';
import Utilisateurs from './components/liste/utilisateurs';
import Ajoututilisateurs from './components/ajout/ajoututilisateurs';
import Updateutilisateurs from './components/edit/updateutilisateurs';
import Ajoutdep from './components/ajout/ajoutdep';
import Home from './components/Home/Home';

class App extends React.Component {
  render() {
  return (
    <div className="container">
      <Router>
    <Route exact path="/">
      <Redirect to="/Home"/>
    </Route>


    <Navbar/>

      <Route path="/utilisateurs" component={Utilisateurs}/>
      <Route path="/updateutilisateurs/:id" component={Updateutilisateurs} />
    <Route path="/ajoututilisateurs" component={Ajoututilisateurs}/>
    <Route path="/ajoutdep" component={Ajoutdep}/>
    </Router>
    </div>
  );
}
}

export default App;
